@import url('https://fonts.googleapis.com/css?family=Montserrat:600italic,400,700,500,600,700italic,400italic');

@font-face {
 font-family: "KyivType Sans-Bold";
 src: url("fonts/Dmitry Rastvortsev - KyivType Sans Bold.woff2") format("woff2");
}

@font-face {
 font-family: "KyivType Sans-Bold3";
 src: url("fonts/Dmitry Rastvortsev - KyivType Sans Bold3.woff2") format("woff2");
}

@font-face {
 font-family: "KyivType Sans-Light";
 src: url("fonts/Dmitry Rastvortsev - KyivType Sans Light.woff2") format("woff2");
}

@font-face {
 font-family: "KyivType Sans-Medium";
 src: url("fonts/Dmitry Rastvortsev - KyivType Sans Medium.woff2") format("woff2");
}

@font-face {
 font-family: "KyivType Sans-Regular";
 src: url("fonts/Dmitry Rastvortsev - KyivType Sans Regular.woff2") format("woff2");
}

* {
  /*user-select: none;*/
box-sizing: border-box;
}
.clickable {
  cursor:  pointer;
}
.align-self-flex-center {

align-self: flex-center;
}
.align-self-flex-end {

align-self: flex-end;
}
.align-self-flex-start {

align-self: flex-start;
}
.animate-nodelay {

animation-delay: 0s;
}
.auto-animated .container-center-vertical,
.auto-animated .container-center-horizontal {

opacity: 1;
}
.auto-animated div {

opacity: 0;
position: absolute;
--z-index: -1;
}
.component-wrapper * {

box-sizing: border-box;
-webkit-font-smoothing: antialiased;
pointer-events: none
}
.component-wrapper a {

text-decoration: none;
display: contents;
pointer-events: auto
}
.component-wrapper a *,
.component-wrapper input,
.component-wrapper video,
.component-wrapper iframe {

pointer-events: auto;
}
.component-wrapper.not-ready,
.component-wrapper.not-ready * {

visibility: hidden !important;
}
.container-center-horizontal {

pointer-events: none;
display: flex;
flex-direction: row;
justify-content: center;
width: 100%;
}
.container-center-horizontal > * {

pointer-events: auto;
flex-shrink: 0;
}
.container-center-vertical {

pointer-events: none;
display: flex;
flex-direction: row;
align-items: center;
height: 100%;
}
.container-center-vertical > * {

pointer-events: auto;
flex-shrink: 0;
}
.full-height-a {

height: 100%;
}
.full-width-a {

width: 100%;
}
.hidden,
.hidden * {

visibility: hidden;
pointer-events: none;
}
.listeners-active,
.listeners-active * {

pointer-events: auto;
}
.listeners-active-click,
.listeners-active-click * {

cursor: pointer;
}
.overlay {

position: absolute;
opacity: 0;
display: none;
top: 0;
width: 100%;
height: 100%;
position: fixed;
}
.overlay.animate-appear {

opacity: 0;
display: block;
animation: reveal 0.3s ease-in-out 1 normal forwards;
}
.overlay.animate-disappear {

opacity: 1;
display: block;
animation: reveal 0.3s ease-in-out 1 reverse forwards;
}
.screen * {

box-sizing: border-box;
-webkit-font-smoothing: antialiased;
}
.screen a {

text-decoration: none;
display: contents;
}
.screen div {

-webkit-text-size-adjust: none;
}
.screen textarea:focus,
.screen input:focus {

outline: none;
}
.smart-layers-pointers,
.smart-layers-pointers * {

pointer-events: auto;
visibility: visible;
}
.valign-text-bottom {

display: flex;
flex-direction: column;
justify-content: flex-end;
}
.valign-text-middle {

display: flex;
flex-direction: column;
justify-content: center;
}
@keyframes reveal {

from {
opacity: 0;
}
to {
opacity: 1;
}
}
input:focus {

outline: none;
}
